INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(7, true, 1, '{"pt":"Colisão com objeto fixo","en":"Collision with fixed object","es":"Colisión con objeto fijo"}', '{"pt":"Acidente em que um veículo em movimento colide com um objeto fixo.",
                                              "en":"Accident in which a moving vehicle collides with a fixed object.",
                                              "es":"Accidente en el que un vehículo en movimiento choca con un objeto fijo."}', 'TA07');
INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(14, false, 14, '{"pt":"Engavetamento","en":"Engavetamento","es":"Engavetamento"}', '{"pt":"Tipo de acidente em que se tem por definição o impacto entre três ou mais veículos transitando na mesma direção e sentido de circulação. Trata-se combinação de veículos como sendo um só veículo."}', 'TA14');
INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(2, true, 4, '{"pt":"Capotamento","en":"Rollover","es":"Volcado"}', '{"pt":"Tipo de acidente em que o veículo dá um giro sobre si, em qualquer sentido, em um ângulo igual ou superior a 180º, imobilizando-se em qualquer posição.",
                                              "en":"Accident in a vehicle suffers rollover.",
                                              "es":"Accidente en un vehículo sufre una volcadura."}', 'TA02');
INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(3, false, 5, '{"pt":"Colisão frontal","en":"Frontal collision","es":"Choque frontal"}', '{"pt":"Tipo de acidente que ocorre quando os veículos transitando na mesma direção, porém, em sentidos opostos, sofrerem impactos em qualquer de suas partes, com alteração substancial de sua quantidade de movimento.",
                                              "en":"Accident in which a moving vehicle undergoes a frontal collision with another vehicle, also moving.",
                                              "es":"Accidente en el que un vehículo en movimiento sufre una colisión frontal con otro vehículo, también en movimiento."}', 'TA03');
INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(4, false, 6, '{"pt":"Colisão lateral","en":"Collision Side","es":"Colisión lateral"}', '{"pt":"Tipo de acidente que ocorre quando os veículos em movimento na mesma direção, mesmo sentido ou em sentidos opostos colidirem simultaneamente, sem alteração substancial de sua quantidade de movimento.",
                                              "en":"Accident in which a moving vehicle undergoes a side collision with another vehicle, also moving.",
                                              "es":"Accidente en el que un vehículo en movimiento sufre una colisión lateral con otro vehículo, también en movimiento."}', 'TA04');
INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(8, false, 10, '{"pt":"Colisão com objeto móvel","en":"Collision with moving object","es":"Colisión con un objeto en movimiento"}', '{"pt":"Tipo de acidente no qual há o impacto de um veículo em movimento contra qualquer objeto em movimento, exceto outro(s) veículo(s).",
                                              "en":"Accident in which a moving vehicle collides with a moving object.",
                                              "es":"Accidente en el que un vehículo en movimiento choca con un objeto en movimiento."}', 'TA08');
INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(9, false, 11, '{"pt":"Derramamento de carga","en":"Load Shedding","es":"Desprendimiento de carga"}', '{"pt":"Tipo de acidente em que ocorre a queda ou derramamento da carga do veículo transportador, com prejuízo de ordem material e/ou pessoal.",
                                              "en":"Accident in which a vehicle tipping the load.",
                                              "es":"Accidente en el que un vehículo vuelque la carga."}', 'TA09');
INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(10, false, 12, '{"pt":"Saída de Pista","en":"Get out of the lane","es":"Salida de pista"}', '{"pt":"Tipo de acidente no qual um veículo sai do leito carroçável da via, provocando danos materiais ao veículo, a terceiros e/ou lesões pessoais. Nas rodovias dotadas de acostamento, considera-se o ponto de saída de pista o limite externo do leito carroçável (acostamento, canteiro central, etc).",
                                              "en":"Accident in which a vehicle comes out of roadway.",
                                              "es":"Accidente en el que un vehículo se sale del carril."}', 'TA10');
INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(11, false, 13, '{"pt":"Tombamento","en":"Rollover (partial)","es":"Volcado (parcial)"}', '{"pt":"Tipo de acidente em que o veículo sai de sua posição normal, imobilizando-se ou não sobre uma de suas laterais, sua frente ou sua traseira.",
                                              "en":"Crash in which a vehicle is involved tipping.",
                                              "es":"Accidente en el que un vehículo se sale de la carretera."}', 'TA11');
INSERT INTO edat.tbl_tipo_acidente (id_tipo_acidente, st_inativo, tp_ordem, ds_nome, ds_descricao, fk_arquivo) VALUES(13, false, 9, '{"pt":"Colisão com objeto estático","en":"Colisão com objeto estático","es":"Colisão com objeto estático"}', '{"pt":"Tipo de acidente no qual há impacto de um veículo em movimento contra qualquer obstáculo fixo, estático ou outro veículo estacionado. O impacto de um veículo parado momentaneamente por circunstâncias do tráfego não configurará colisão com objeto estático, e sim colisão traseira.",
                                              "en":"Acidente no qual há impacto de um veículo em movimento contra qualquer obstáculo fixo, estático ou outro veículo estacionado. O impacto de um veículo parado momentaneamente por circunstâncias do tráfego não configurará colisão com objeto estático, e sim colisão traseira.",
                                              "es":"Acidente no qual há impacto de um veículo em movimento contra qualquer obstáculo fixo, estático ou outro veículo estacionado. O impacto de um veículo parado momentaneamente por circunstâncias do tráfego não configurará colisão com objeto estático, e sim colisão traseira."}', 'TA13');




